    [],nt"revision_timestamp": "2016-03-21T23:23:17.987272",nt"name": "golden-crab-data",nt"isopen":
    false,nt"url": null,nt"notes": "In November 1995, a voluntary logbook program
    for the golden crab fishery in the waters under the jurisdiction of the South Atlantic
    Fishery Management Council (SAFMC) was initiated by the National Marine Fisheries
    Service (NMFS). This Golden Crab Trip Report Logbook program became mandatory when
    regulations for the golden crab fishery management plan went into effect on October
    28, 1996. Regulations require that all fishers that have been issued a Federal vessel
    permit for the golden crab fishery in the South Atlantic region must complete and
    submit a logbook form for each fishing trip on which golden crabs are caught. All
    reporting must be done on log forms that are provided by the Southeast Fisheries
    Science Center (SEFSC) and must be returned to the SEFSC for data processing.",nt"license_title":
